import React from 'react';

class App extends React.Component {
    render() {
        return (
            <div>
                <div id='title'><h1>Pomodoro Clock</h1></div>
                  <div id='lengthDiv'>
                    <div id='breakLength'>
                        <h3>Break Length</h3>
                        <p><i class="arrow down"></i></p>
                    </div>
                      <div id='sessionLength'>
                          <h3>Session Length</h3>

                      </div>
                  </div>
                        <div id='clock'></div>
                          <div id='clockBtns'></div>
            </div>
        )
    }
}

export default App;
